センターコンソールに取り付ける増設USBポート+12Vシガーソケットです。<br>USBは充電状態を示すインジケーター、機種を自動判別する回路搭載。<br>iPhone7/iPhone7 PLUS、スマホも安心して充電出来ます。<br><br>※充電中は「赤色」充電完了時は「青色」にインジケーターが変化します。<br>※機種自動判別回路はUSB充電タイプの機器（スマートフォン、タブレット、iPad、iPhone等）を自動判別し、最も適切な電流で電源供給・充電します。<br><br><br>ON/OFFスイッチ付きLED照明でトレイを明るく照らし、夜間のドライブ時も便利に使用出来ます。<br><br><br>両面テープで取り付けるだけなので、<br>女性の方でも簡単に取付可能です。<br><br>お手軽に愛車をグレードアップしてみませんか？<br><br><br>●適合車種：プリウス ZVW50系<br>●定格：<br>電圧/DC12V 電流/6A以下（USBを含む）<br>USB出力/DC5V 2.4A(2ポート合計4.8A) 10Aヒューズ（プラグ内蔵）<br>●メーカー品番：EE-206<br>●メーカー：星光産業<br><br>※本製品は星光産業製のシフトノブパネル（EE-204）と同時使用可能です。<br>他社製品のシフトノブパネルの場合、干渉して装着出来ない場合がございます。<style type="text/css">
