VIPカーの定番スタイルジャンクションプロデュース！<br><br>機能性はもちろん、見た目もGOODなネックパッドです。<br>首筋に心地よくフィットして運転時の疲れを緩和します。<br><br>各シートに適合するために締め込み調整ベルトがついてます。<br>取付は純正のヘッドレストとシードの間にベルトを挟みこむだけなので女性の方でも簡単にお取り付け頂けます。<br><br>※ヘッドレストの高さが調整可能なシートに適合いたします。<br><br><br>●個数：1個（運転席、助手席でお使いになられたい場合は2個注文下さい。）<br> ●カラー：ブラック x ホワイト<br>●サイズ：約25cm X 15cm<br>●素材：フェイクレザー<br>●メーカー：ジャンクションプロデュース<style type="text/css">
